import React,{Component} from "react";
import "../../scss/components/__sendnotification.scss";

class Send extends Component {
  
    render(){
      
        return(
          
                <div className="upload-wrapper">
                  <div  className="Selectusers">
                  <form>
                     <input type="text" value=""> Select User</input>
                     <input type="text"  value=""> Upload track</input>
                     <input type="text"  value=""> select cover art</input>
                     <input type="text"  value=""> UPC code</input>
                     <input type="text"  value=""> IRC code</input>
                     <input type="text"  value=""> DSP code</input>
                     </form>
                  </div>
                </div>
        )
    }

};

export default Send;
